  "tutorial-5-heading": "Maintaining Posture",
  "tutorial-5": "Use the arrows to transfer poses between blocks and the robot.",
  "tutorial-6-heading": "Let it go",
  "tutorial-6": "To run your program just click the large play button in the 3D view.",
  "tutorial-7-heading": "Context is Everything",
  "tutorial-7": "The context menus give you additional control over your program. You can also load and save programs there!",
  "tutorial-rf-heading": "Robot Driver's License",
